%script 
--Drop any previous models for Notebook repeatability

DECLARE
v_sql varchar2(100);

BEGIN
    v_sql := 'CALL DBMS_DATA_MINING.DROP_MODEL(''MODEL_NAME_NM'')';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no model exists');
END;
/

%script

DECLARE
v_sql varchar2(100);

--drop build settings 
BEGIN
    v_sql := 'DROP TABLE SETTINGS_TABLE_NAME_NM';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;
/

%script 

DECLARE
v_sql varchar2(100);

--Create a Build Setting for DT Model Build 
BEGIN
    v_sql := 'CREATE TABLE SETTINGS_TABLE_NAME_NM (SETTING_NAME  VARCHAR2(30),SETTING_VALUE VARCHAR2(4000))';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': create failed');
END;
/

%script 
BEGIN
  -- Populate settings table
  insert into SETTINGS_TABLE_NAME_NM (SETTING_NAME, SETTING_VALUE) values
  (DBMS_DATA_MINING.PREP_AUTO,DBMS_DATA_MINING.PREP_AUTO_ON);
  -- Other examples of possible overrides are:
  -- (dbms_data_mining.feat_num_features, 10);
  -- (dbms_data_mining.nmfs_conv_tolerance,0.05);
  -- (dbms_data_mining.nmfs_num_iterations,50);
  -- (dbms_data_mining.nmfs_random_seed,-1);
END;
/
